import React, { Component } from 'react';
import './Query.css';

class Query extends Component {
    state = {
        keyword: ''
    }

    constructor(props) {
        super(props);
        this.state.keyword = this.props.query;
    }

    initKeyword() {
        this.setState({
            keyword: this.props.query
        })
    }

    
    searchQeury = (e) => {
        this.setState({
            redirect: true
        });
    }


    render() {
        return (
            <div className="query-contatiner">
                Query Page {this.state.keyword}
            </div>
        )
    }
}

export default Query;
